%[text] ## Crear el robot
robot_trayectories = erobotics_interface() %[output:2b41328d] %[output:5be6e0d7]
fprintf('robot inizializado') %[output:7e43c31c]
  %[control:button:3b9e]{"position":[1,2]}
%%
%[text] ## Iniciar visualización de las Joints
robot_trayectories.verDatos(true) %[output:8d092cb4] %[output:941cea32]
  %[control:button:7829]{"position":[1,2]}
%%
%[text] ## Llevar robot a posición inicial
robot_trayectories.moverRobot([0, 0, 0, 0, 0, 45], 2) %[output:66831302]
  %[control:button:71aa]{"position":[1,2]}
%%
%[text] ## Definir posición deseada
J1 = 0 %[control:slider:2406]{"position":[6,7]} %[output:57ecb4d1]
J2 = 0 %[control:slider:00dc]{"position":[6,7]} %[output:151dec3a]
J3 = 0 %[control:slider:9bd1]{"position":[6,7]} %[output:242760e5]
J4 = 0 %[control:slider:4837]{"position":[6,7]} %[output:300368c1]
J5 = 0 %[control:slider:9e07]{"position":[6,7]} %[output:70e474db]
J6 = 0 %[control:slider:53f5]{"position":[6,7]} %[output:4ce28219]
%%
%[text] ## Mover a posición deseada
angles = [J1, J2, J3, J4, J5, J6];
robot_trayectories.moverRobot(angles, 2); %[output:5ae93346]
  %[control:button:31f3]{"position":[1,2]}
%%
%[text] ## Borrar el robot
delete(robot_trayectories); %[output:0cc51dd3]

